relatedmaterial.p:
Allereerst zij gewezen op de archieven van de voorlopers van de Raad van State, voordat deze in 1588 zijn definitieve vorm kreeg: 


archief van gouverneur-generaal Matthias, aartshertog van Oostenrijk, en de Raad van State nevens hem, 1578-158-, nummer toegang 1.01.01.02;


archief van de Kamer der Beden van de Generaliteit: Tresorier-Generaal; Ontvanger-Generaal der Beden van de Generaliteit, 1576-1581, nummer toegang 1.01.01.03;


archief van de Generale Landraad [1581-1582]; François, Hertog van Anjou en de Raad van State nevens hem [1582-1583], 1581-1583, nummer toegang 1.01.01.05;


archief van de gemachtigden tot het Beleid der Financiën en Beden [1582]; Kamer der Beden [1582-1584], (1577) 1582-1584, nummer toegang 1.01.01.06;


archief van de gedeputeerden van de Geünieerde Provinciën aan de Oostzijde der Maze, 1583, nummer toegang 1.01.01.08;


archief van de Raad van State, 1584-1586, nummer toegang 1.01.01.09;


archief van de gouverneur-generaal graaf van Leycester en de Raad van State nevens hem, 1586-1588, nummer toegang 1.01.01.10;


archief van de Kamer van de Tresorie dezer Landen [1586]; Kamer van Financiën en Domeinen [1586]; Kamer van de Tresorie [1586-1588], 1586-1588, nummer toegang 1.01.01.11.

Ook andere colleges en instituten dan de Raad van State bemoeiden zich met zaken die tot het taakgebied van de Raad van State gerekend kunnen worden. Voor onderzoek naar dergelijke zaken, verdient het aanbeveling ook de archieven van deze colleges te raadplegen. De colleges waren: 


de Staten-Generaal, nummer toegang 1.01.02;


de Generaliteitsrekenkamer, nummer toegang 1.01.43;


de Stadhouderlijke Secretarie, nummer toegang 1.01.50;


de Hoge Krijgsraad (militaire jurisdictie), nummer toegang 1.01.45.

In de particuliere archieven van personen die functies in de Raad van State en Staten-Generaal bekleedden, zijn ook stukken betreffende de Raad van State en diens bemoeienissen te vinden: 


Collectie Fagel, 1513-1927, nummer toegang 1.10.29;


Collectie Fagel, Supplement, 1524-1795, nummer toegang 1.10.94;


Collectie Bisdom, 1280-1810, nummer toegang 1.10.06;


Archief Adriaan Bogaers, 18e eeuw, nummer toegang 1.10.19;


Collectie Evertsen, 19e eeuw, nummer toegang 1.10.28;


Archief Van Hees, 18e eeuw, nummer toegang 1.10.96;


Collectie Van der Hoop, 1287-1807, nummer toegang 1.10.42 - 1.10.44

bioghist.p:
Staats-Brabant kwam grotendeels overeen met de huidige provincie Noord-Brabant. Niet tot dit gebied behoorden:


Hollands Brabant: Klundert, Zevenbergen, Zwaluwe, Geertruidenberg, Biesbosch, Land van Heusden en Altena, de Langstraat;


Vrije en Rijksheerlijkheden: Gemert, Ravestein, Megen, Boxmeer;


Luikse gebieden: Bokhoven en Luijksgestel


Kleefse gebied: Oeffelt

 Wel tot Staats-Brabant behoorde het huidige Belgische Lommel.
